    <title>ProViewer - Paid content viewer</title>

    <style>
        :root {
            --background-color: #f5f5f7;
            --text-color: #1d1d1f;
            --accent-color: #0071e3;
            --card-background: #ffffff;
            --border-color: #d2d2d7;
            --hover-color: #0077ed;
            --name-color: #ffd700;
        }

        * {
            box-sizing: border-box;
            margin: 0;
            padding: 0;
        }

        body {
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Helvetica, Arial, sans-serif;
            background-color: var(--background-color);
            color: var(--text-color);
            line-height: 1.47059;
            font-weight: 400;
            letter-spacing: -0.022em;
        }

        .container {
            max-width: 980px;
            margin: 0 auto;
            padding: 2rem 1rem;
        }

        header {
            text-align: center;
            margin-bottom: 3rem;
        }

        h1 {
            font-size: 48px;
            font-weight: 600;
            letter-spacing: -0.003em;
            margin-bottom: 0.5rem;
        }

        .user-profile {
            background-color: var(--card-background);
            border-radius: 18px;
            padding: 2rem;
            margin-bottom: 3rem;
            box-shadow: 0 2px 8px rgba(0, 0, 0, 0.04);
            text-align: center;
            position: relative;
            overflow: hidden;
        }

        .user-profile::before {
            content: "proviewer.pro";
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%) rotate(-45deg);
            font-size: 4rem;
            color: rgba(0, 0, 0, 0.05);
            white-space: nowrap;
            pointer-events: none;
        }

        .user-profile h2 {
            font-size: 28px;
            font-weight: 600;
            letter-spacing: -0.003em;
            margin-bottom: 1.5rem;
        }

        .user-avatar {
            width: 200px;
            height: 200px;
            margin: 0 auto 1.5rem;
            object-fit: cover;
        }

        .user-stats {
            display: flex;
            justify-content: center;
            gap: 2rem;
            margin-bottom: 2rem;
        }

        .stat {
            font-size: 17px;
        }

        .stat-value {
            font-weight: 600;
            font-size: 24px;
            display: block;
            margin-bottom: 0.5rem;
        }

        .button {
            padding: 0.8rem 2rem;
            font-size: 17px;
            color: #fff;
            background-color: var(--accent-color);
            border: none;
            border-radius: 980px;
            cursor: pointer;
            transition: all 0.3s ease;
            text-decoration: none;
        }

        .button:hover {
            background-color: var(--hover-color);
        }

        .button i {
            margin-right: 0.5rem;
        }

        .button .user-name {
            color: var(--name-color);
            font-weight: 600;
        }

        footer {
            text-align: center;
            padding: 2rem 0;
            font-size: 12px;
            color: #86868b;
        }

        footer a {
            color: #515154;
            text-decoration: none;
            margin: 0 10px;
        }

        footer a:hover {
            text-decoration: underline;
        }

        .latest-profiles-title {
            font-size: 32px;
            font-weight: 600;
            text-align: center;
            margin-bottom: 2rem;
            color: var(--text-color);
        }

        @media (max-width: 734px) {
            h1 {
                font-size: 40px;
            }

            .user-profile h2 {
                font-size: 24px;
            }

            .user-stats {
                flex-direction: column;
                gap: 1rem;
            }

            .user-profile::before {
                font-size: 3rem;
            }

            .latest-profiles-title {
                font-size: 28px;
            }
        }
    </style>
</head>
